import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom';
import { Navbar, Nav, Image, Container, Row, Col, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import logo from './Zogly.png';
import Home from './routes/home';
import Calculator from './routes/calculator';
import Contact from './routes/contact';
import AboutUs from './routes/aboutus';
import Checkout from './routes/checkout';
import Success from './routes/success';
import Login from './routes/login';
import Account from './routes/account';

function App() {
const [user, setUser] = useState(null);

useEffect(() => {
  const fetchUserInfo = async () => {
    try {
      const response = await fetch('http://localhost:5000/user');
      const data = await response.json();
      if (data.username) {
        setUser(data.username);
      } else {
        setUser(null);
      }
    } catch (error) {
      console.error('Error fetching user info:', error);
    }
  };

  fetchUserInfo();
}, []);

const handleLogout = async () => {
  const response = await fetch('http://localhost:5000/logout', {
    method: 'DELETE',
    headers: {
      'Content-Type': 'application/json',
    }
  });

if (response.ok) {
  setUser(null);
} else {
  console.error('Logout failed');
}

}

  return (
    <Router>
      <div className="App" translate='yes'>
        <Container fluid style={{ padding: 0 }}>
          <div className='Header'>
            <Row>
              <Col xs={8} style={{ padding: 0 }}>
                <Navbar expand="lg" className="navbar-custom" variant="dark">
                  <Navbar.Brand href="/">
                    <Image src={logo} alt="Logo" fluid className="nav-logo" />
                  </Navbar.Brand>
                  <Navbar.Toggle aria-controls="basic-navbar-nav" />
                  <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                    {!user && (
                      <Nav.Link as={Link} to="/">Login</Nav.Link>
                    )}
                    {user && (
                      <>
                      <Nav.Link as={Link} to="/account">My Account</Nav.Link>
                      <Nav.Link onClick={handleLogout}>Logout</Nav.Link> 
                      </>
                    )}
                      <Nav.Link as={Link} to="/home">Home</Nav.Link>
                      <Nav.Link as={Link} to="/calculator">Calculator</Nav.Link>
                      <Nav.Link as={Link} to="/aboutus">About Us</Nav.Link>
                      <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
                    </Nav>
                    <Nav className="ms-auto">
                      <Nav.Link as={Link} to="/">Zogly</Nav.Link>
                    </Nav>
                  </Navbar.Collapse>
                </Navbar>
              </Col>
            </Row>
          </div>
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/account" element={<Account />} />
            <Route path="/home" element={<Home />} />
            <Route path="/calculator" element={<Calculator />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/aboutus" element={<AboutUs />} />
            <Route path="/checkout" element={<Checkout />} />
            <Route path="/sucess" element={<Success />}/>
          </Routes>
          <div className='Footer'>
            <Row>
              <Col style={{ paddingLeft: 0 }}>
                <Navbar expand="lg" className="navbar-custom" variant="dark">
                  <Navbar.Brand href="/">
                    <Image src={logo} alt="Logo" fluid className="nav-logo" />
                  </Navbar.Brand>
                  <Navbar.Toggle aria-controls="basic-navbar-nav" />
                  <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                      <Nav.Link href="#facebook">Facebook</Nav.Link>
                      <Nav.Link href="#twitter">Twitter</Nav.Link>
                      <Nav.Link href="#instagram">Instagram</Nav.Link>
                      <Nav.Link href='#sources'>Sources</Nav.Link>
                    </Nav>
                    <Nav className="ms-auto">
                      <Nav.Link as={Link} to="/home">Zogly</Nav.Link>
                    </Nav>
                  </Navbar.Collapse>
                </Navbar>
              </Col>
            </Row>
          </div>
        </Container>
      </div>
    </Router>
  );
}

export default App;
